import React from "react";
import { CardColumn } from "./cardColumn";
import customerCard from "./customerCard.module.scss";

export const CustomerCard = ({ items, exceeded, handleModalData, meters }) => {
  return (
    <div className={customerCard.card} onClick={() => handleModalData(items)}>
      {meters &&
        meters.map((item, index) => (
          <CardColumn
            key={index}
            limit={items[item].limit}
            usage={items[item].usage}
          />
        ))}
      <div>{exceeded && <span className={customerCard.warning}>Exceeded</span>}</div>
    </div>
  );
};
